import React from 'react';
import logo from '../logo.jpeg';

const Header = () => {
  return (
    <header className="header">
      <div className="header-content">
        <img src={logo} alt="Bascare Logo" className="logo-img" />
        <div className="header-text">
          <h1 className="title">Bascare</h1>
          <p className="subtitle">Premium Beauty & Skincare Products</p>
        </div>
      </div>
    </header>
  );
};

export default Header;
